/**
=========================================================
* Material Dashboard 2 React - v2.2.0
=========================================================

* Product Page: https://www.creative-tim.com/product/material-dashboard-react
* Copyright 2023 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

import React,{ useState,useEffect } from "react";

// @mui material components
import Card from "@mui/material/Card";
import Icon from "@mui/material/Icon";
import Menu from "@mui/material/Menu";
import MenuItem from "@mui/material/MenuItem";
import axios from "axios"

// Material Dashboard 2 React components
import MDBox from "components/MDBox";
import MDTypography from "components/MDTypography";

// Material Dashboard 2 React examples
import DataTable from "examples/Tables/DataTable";

// Data
import data from "layouts/dashboard/components/Projects/data";
import TableContainer from "@mui/material/TableContainer";
import Table from "@mui/material/Table";
import { Modal, Paper, TableCell, TableHead } from "@mui/material";
import TableRow from "@mui/material/TableRow";
import TableBody from "@mui/material/TableBody";
import Button from "@mui/material/Button";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
const style = {
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 900,
  bgcolor: 'background.paper',
  border: '2px solid #000',
  boxShadow: 24,
  p: 4,
};
function Projects() {
  const { columns, rows } = data();
  const [menu, setMenu] = useState([]);

  const [prdetails,setPrdetails] = useState([])
  const [commitdetails,setCommitDetails] = useState([])

  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);




  useEffect(() => {
    axios
      .get(`https://6be9-2405-201-d01a-18af-bda8-483e-1e3e-30ba.ngrok-free.app/v1/services`)
      .then((resp) => {
        console.log("resp", resp);
        const data = resp.data;

        console.log("datajson",data)
        setMenu(data)
      })
      .catch(function (error) {
        console.log(error);
      });
  }, []);

  const openMenu = ({ currentTarget }) => setMenu(currentTarget);
  const closeMenu = () => setMenu(null);

  const selectoption =(e)=>{
    console.log(e)

const selectedoption = e.target.value;
    console.log("selected",selectedoption)
    axios
      .get(`https://6be9-2405-201-d01a-18af-bda8-483e-1e3e-30ba.ngrok-free.app/v1/pr?service_id=` + selectedoption)
      .then((resp) => {
        console.log("resp", resp);
        const data = resp.data;

        console.log("data", data);

        setPrdetails(data)
      })
      .catch(function (error) {
        console.log(error);
      });
  }

  const [unittest,setunitDetails] = useState({"commit_id": "",
    "pass": '',
    "failed": '',
    "skipped": '',
    "overall_coverage": '',
    "modified_coverage": ""})
  const [ec2coverage,setec2coverage] = useState({"commit_id": "",
    "pass": '',
    "failed": '',
    "skipped": '',
    "overall_coverage": '',
    "modified_coverage": ""})
  const [integration_coverage,setintegration_coverage] = useState({"commit_id": "",
    "pass": '',
    "failed": '',
    "skipped": '',
    "overall_coverage": '',
    "modified_coverage": ""})
  const checkCommitId =(e)=>{
    handleOpen()
    console.log(e)
    const selectedcommitId = e.commit_id;
    console.log("selectedcommitId",selectedcommitId)
    axios
      .get(`https://6be9-2405-201-d01a-18af-bda8-483e-1e3e-30ba.ngrok-free.app/v1/metrics?commit_id=` + selectedcommitId)
      .then((resp) => {
        console.log("resp", resp);
        const data = resp.data;

        console.log("data", data);

        const unittestdata = data.unit_test
        const ec2coverage = data.e2e_test
        const integration_coverage = data.integration_coverage
        console.log("unittestdata",unittestdata)

        setunitDetails({
          "commit_id": unittestdata.commit_id,
          "pass": unittestdata.pass,
          "failed": unittestdata.failed,
          "skipped": unittestdata.skipped,
          "overall_coverage": unittestdata.overall_coverage,
          "modified_coverage": unittestdata.modified_coverage
        });
        setec2coverage({
          "commit_id": ec2coverage.commit_id,
          "pass": ec2coverage.pass,
          "failed": ec2coverage.failed,
          "skipped": ec2coverage.skipped,
          "overall_coverage": ec2coverage.overall_coverage,
          "modified_coverage": ec2coverage.modified_coverage
        });

        setintegration_coverage({
          "commit_id": integration_coverage.commit_id,
          "pass": integration_coverage.pass,
          "failed": integration_coverage.failed,
          "skipped": integration_coverage.skipped,
          "overall_coverage": integration_coverage.overall_coverage,
          "modified_coverage": integration_coverage.modified_coverage
        });
      })
      .catch(function (error) {
        console.log(error);
      });
  }


  const renderMenu = (
    <Menu
      id="simple-menu"
      anchorEl={menu}
      anchorOrigin={{
        vertical: "top",
        horizontal: "left",
      }}
      transformOrigin={{
        vertical: "top",
        horizontal: "right",
      }}
      open={Boolean(menu)}
      onClose={closeMenu}
    >

      <MenuItem onClick={closeMenu}>Action</MenuItem>
      <MenuItem onClick={closeMenu}>Another action</MenuItem>
      <MenuItem onClick={closeMenu}>Something else</MenuItem>
    </Menu>
  );

  return (
    <Card>
      <Card>

      </Card>


      <MDBox display="flex" justifyContent="space-between" alignItems="center" p={3}>
        <MDBox>
          <MDTypography variant="h6" gutterBottom>
            Service Details
          </MDTypography>
        </MDBox>
        {/*<Menu*/}
        {/*  id="simple-menu"*/}
        {/*  anchorEl={menu}*/}
        {/*  anchorOrigin={{*/}
        {/*    vertical: "top",*/}
        {/*    horizontal: "left",*/}
        {/*  }}*/}
        {/*  transformOrigin={{*/}
        {/*    vertical: "top",*/}
        {/*    horizontal: "right",*/}
        {/*  }}*/}
        {/*  open={Boolean(menu)}*/}
